package main import ( "fmt" "math/bits"
) // Calcula paridade par (retorna 0 ou 1)
func parityBit(data byte) byte { if bits.OnesCount8(data)%2 == 0 { return 0 // já é par } return 1
} // Verifica a paridade de um byte + bit extra
func checkParity(data byte, parity byte) bool { return parityBit(data) == parity
} func main() { data := byte(0b10101110) // 5 bits 1 parity := parityBit(data) fmt.Printf("Paridade calculada: %d\n", parity) valid := checkParity(data, parity) fmt.Printf("Verificação: %v\n", valid) // Simulando erro corrupted := data ^ 0b00000100 // inverte o bit 2 valid = checkParity(corrupted, parity) fmt.Printf("Verificação após erro: %v\n", valid)
}

