O CRC-8 é uma das versões mais simples, usando um polinômio de 8 bits. package main import ( "fmt"
) // Tabela CRC-8 para polinômio 0x07 (x^8 + x^2 + x + 1)
var crc8Table [256]byte // Inicializa a tabela CRC-8
func init() { const poly = byte(0x07) for i := 0; i < 256; i++ { crc := byte(i) for j := 0; j < 8; j++ { if (crc & 0x80) != 0 { crc = (crc << 1) ^ poly } else { crc <<= 1 } } crc8Table[i] = crc }
} // Calcula CRC-8 para um conjunto de dados
func CRC8(data []byte) byte { crc := byte(0) for _, b := range data { crc = crc8Table[crc^b] } return crc
} func main() { data := []byte("HELLO") fmt.Printf("CRC-8 de 'HELLO': 0x%X\n", CRC8(data))
} O CRC, diferente do checksum, detecta trocas na ordem dos bytes, detecta erros simples de mútiplos bits errados e possui menor taxa de colisões. Mas o CRC-8 não é reistente a ataques maliciosos (não deve ser usado para segurança) e pode falhar na detecção de alguns padrões específicos de erro se o polinômio não for bem escolhido.

128.body:
Funções hash são operações matemáticas que transformam uma entrada de qualquer tamanho em uma saída de tamanho fixo. Para uma mesma entrada, a saída gerada será sempre a mesma. Uma das principais propriedades das funções hash é que a operação é irreversível, ou seja, não é possível obter a entrada original a partir da saída gerada. Além disso, o tamanho da saída é sempre fixo, independentemente do tamanho da entrada. Isso significa que uma entrada curta e uma entrada muito longa geram um hash com a mesma quantidade de bits. Embora seja esperado que entradas diferentes gerem hashes diferentes, existe a possibilidade de colisões, onde duas entradas distintas podem produzir o mesmo hash. A qualidade da função hash está diretamente ligada à sua capacidade de minimizar essas colisões. Para começar, vamos criar uma função hash simples e passar por todos os pontos mencionados acima. Nossa função hash vai fazer o seguinte: dada uma entrada, somamos os valores ASCII da entrada e dessa soma obtemos o módulo 256, ou seja, teremos sempre um valor entre 0 e 255 não importando o tamanho da entrada. Acompanhe: package main import ( "fmt"
) func simpleHash(in string) int { hash := 0 for _, char := range in { hash += int(char) } return hash % 256
} func main() { input1 := "willams sousa" input2 := "Go" input3 := "xyz" fmt.Printf("Hash de '%v':%v\n", input1, simpleHash(input1)) fmt.Printf("Hash de '%v':%v\n", input2, simpleHash(input2)) fmt.Printf("Hash de '%v':%v\n", input3, simpleHash(input3))
} Nosso simpleHash tem apenas 256 saídas possíveis, mas pode processar infinitas entradas distintas. Isso inevitavelmente leva a colisões, pois, pelo Princípio da Pomba (Pigeonhole Principle), há mais entradas possíveis do que saídas distintas. Por exemplo, todo palíndromo leva a colisões, pois a soma é uma operação comutativa, e a soma dos códigos ASCII dessas strings produz sempre o mesmo valor, independentemente da ordem dos caracteres. Mas esse problema não se restringe apenas a palíndromos. A string "wow" e "zft" também colidem, pois: "wow" → w=119, o=111, w=119 → 119 + 111 + 119 = 349 "zft" → z=122, f=102, t=125 → 122 + 102 + 125 = 349 Isso demonstra que a ordem dos caracteres não é levada em conta, resultando em muitas colisões. Propriedades de funções hash aplicadas ao simpleHash: Determinística: Para a mesma entrada, sempre obtemos a mesma saída. Irreversível: Nossa função não é verdadeiramente irreversível, pois permite encontrar entradas compatíveis facilmente. Alta entropia e efeito avalanche: Pequenas mudanças na entrada não causam mudanças drásticas no hash. Resistência à pré-imagem: Se tivermos o valor H, podemos facilmente encontrar um X tal que hash(X) = H, devido ao baixo espaço de saída. Saída de tamanho fixo: A saída sempre tem 256 valores possíveis, independentemente do tamanho da entrada. Apesar disso, nosso algoritmo parece irreversível, mas pelos motivos errados! Devido à enorme incidência de colisões, não temos como saber qual foi a entrada exata que gerou determinada saída. Isso, porém, não é uma característica desejável em uma função hash criptográfica. Simple Hash Podemos melhorar nossa função hash usando multiplicação por um fator primo melhorando a dispersão e reduzindo colisões triviais. P.ex: func betterHash(input string) int { hash := 0 prime := 31 // Usar um número primo ajuda a dispersar os valores for i, char := range input { hash = hash*prime + int(char) } return hash & 0xFFFFFFFF // tamanho fixo (32 bits)
} Contudo, o espaço da saída ainda é muito pequeno, estamos limitando a saída a 32 bits. Para grandes volumes de dados as colisões ainda serão inevitáveis e o algorítmo também não é resistente a pré-imagem. Além disso, pequenas mudanças na entrada não afetam significativamente a saída (efeito avalanche). Esses exemplos foram um ótimo ponto de partida, mas a computação exigiu funções hash mais poderosas. Vamos analisar como os algoritmos evoluíram ao longo do tempo até chegarmos às soluções modernas, como o SHA-256.

