Aqui está um exemplo que mostra como o endianness influencia diretamente a forma como blocos de dados são interpretados em cifras de bloco como o RC2 (ou mesmo DES). Vamos simular a codificação de um bloco de 64 bits em que a ordem dos bytes impacta o valor numérico processado: package main import ( "encoding/binary" "fmt"
) // Simula um processamento de bloco que depende da ordem dos bytes.
// Ex: RC2/DES usam blocos de 64 bits interpretados como dois inteiros de 32 bits.
func processBlock(b []byte, order binary.ByteOrder) { if len(b) != 8 { panic("Bloco precisa ter 8 bytes") } left := order.Uint32(b[:4]) right := order.Uint32(b[4:]) fmt.Printf("Bloco interpretado como:\n") fmt.Printf(" L = 0x%08X\n", left) fmt.Printf(" R = 0x%08X\n", right)
} func main() { // Exemplo de bloco de 64 bits (8 bytes) com valor fixo block := []byte{0x01, 0x23, 0x45, 0x67, 0x89, 0xAB, 0xCD, 0xEF} fmt.Println("== Interpretação Big-endian (protocolos de rede, SHA, etc.)") processBlock(block, binary.BigEndian) fmt.Println("\n== Interpretação Little-endian (como em x86 e x86_64)") processBlock(block, binary.LittleEndian)
} Saída esperada: == Interpretação Big-endian (protocolos de rede, SHA, etc.)
Bloco interpretado como: L = 0x01234567 R = 0x89ABCDEF == Interpretação Little-endian (como em x86 e xx86_64)
Bloco interpretado como: L = 0x67452301 R = 0xEFCDAB89 Esse exemplo mostra que o mesmo bloco de bytes resulta em valores completamente diferentes para L e R, dependendo do endianness. Esse fator afeta diretamente muitos algoritmos de cifra — especialmente cifras de bloco — que tratam blocos de N bits como inteiros de 16 ou 32 bits, sobre os quais aplicam operações lógicas, rotações e substituições.

