A especificação do MD2 pode ser encontrada na RFC 1319. Esse algorítmo transforma qualquer entrada em um hash de 128bits. Ele faz isso seguindo 3 etapas principais: 1 - Padding Para garantir que o tamanho da entrada seja um múltiplo de 16 bytes, adicionamos bytes de padding no final. A regra é a seguinte: se o tamanho da mensagem já for múltiplo de 16, adicionamos 16 bytes com o valor 0x10 (16 em decimal). se faltar N bytes para completar 16, adicionamos N bytes com o valor de N. Exemplo: Padding MD2 Ou seja: Etapa Dados Entrada original Hexa: [41 42 43] = "ABC" Tamanho 3 bytes Padding necessário 16 - 3 = 13 bytes Preenchimento Faltam 13 bytes , então usamos 0x0D (13) Resultado final [41 42 43 0D 0D 0D 0D 0D 0D 0D 0D 0D 0D 0D 0D 0D] Se a entrada tivesse 15 bytes, haveria um padding de 1 byte com o valor 0x01, se tivesse exatamente 16 bytes, faríamos um padding de mais 16 bytes com o valor 0x10 (16 em decimal), e assim por diante. 2 - Checksum O MD2 adiciona um checksum de 16 bytes, que é computado iterando sobre a mensagem e aplicando XOR com uma tabela de permutação. Essa tabela de permutação S-box (256 valores) foi escolhida manualmente por Rivest e é baseada em uma permutação "aleatória" dos dígitos de Pi. Uma S-box (Substitution Box) é uma tabela de substituição não linear usada em criptografia para aumentar a confusão, um conceito fundamental introduzido por Claude Shannon em seu estudo seminal sobre teoria da criptografia (Shannon, 1949)[1]. O objetivo do checksum no MD2 é adicionar redundância e garantir que qualquer alteração na mensagem original impacte significativamente o resultado final. O checksum não serve como verificação de integridade tradicional (como em CRCs), mas sim para aumentar a resistência do algoritmo contra colisões. Como o Checksum é Calculado? A cada bloco de 16 bytes da mensagem (com padding já aplicado), percorremos byte a byte e atualizamos o checksum usando a tabela S-Box. O cálculo segue a seguinte fórmula: C[j] = C[j] XOR S[M[i * 16 + j] XOR L]
L = C[j] Onde: C[j] -> byte j do checksum M[i * 16 + j] -> byte j do bloco i da mensagem S[x] -> S-Box, uma tabela de substituição com 256 valores, indexada pelo resultado do XOR L -> Último valor atualizado do checksum, começando com 0. Veja um passo a passo com valores reais: Suponha que: C[3] = 0xA5 M[3] = 0x7F L = 0x2C S[0x53] = 0xD4 (porque 0x7F XOR 0x2C = 0x53) Agora, aplicamos: C[3] = C[3] XOR S[ M[3] XOR L ] = 0xA5 XOR S[0x53] = 0xA5 XOR 0xD4 = 0x71 L = C[3] = 0x71 Essa fase adiciona o efeito de difusão na mensagem antes da fase final. A difusão é um conceito introduzido por Claude Shannon [Shannon, 1949] [1], onde pequenas mudanças na entrada devem se espalhar por toda a saída, dificultando a recuperação do texto original a partir do hash ou da cifra Após processar todos os blocos, os 16 bytes do checksum são anexados à mensagem. Implementação em Go var SBox = [256]byte{ 41, 46, 67, 201, 162, 216, 124, 1, 61, 54, 84, 161, 236, 240, 6, 19, 98, 167, 5, 243, 192, 199, 115, 140, 152, 147, 43, 217, 188, 76, 130, 202, 30, 155, 87, 60, 253, 212, 224, 22, 103, 66, 111, 24, 138, 23, 229, 18, 190, 78, 130, 235, 167, 56, 19, 64, 70, 57, 64, 195, 148, 36, 198, 28, 242, 101, 37, 149, 184, 120, 215, 68, 76, 168, 73, 226, 70, 32, 62, 203, 113, 107, 34, 82, 178, 175, 212, 81, 78, 100, 212, 180, 38, 186, 59, 113, 79, 52, 202, 51, 89, 197, 60, 22, 184, 79, 63, 174, 196, 142, 95, 35, 235, 221, 169, 128, 248, 105, 194, 54, 204, 134, 179, 227, 91, 225, 92, 239, 191, 138, 75, 209, 123, 112, 147, 131, 175, 148, 100, 245, 196, 56, 109, 92, 241, 241, 107, 206, 161, 24, 108, 72, 85, 176, 46, 130, 187, 20, 166, 76, 101, 150, 53, 216, 38, 244, 186, 155, 43, 80, 231, 49, 205, 18, 38, 141, 106, 169, 173, 89, 151, 152, 145, 232, 165, 29, 214, 32, 212, 185, 58, 5, 208, 141, 116, 55, 63, 158, 98, 164, 218, 228, 67, 193, 66, 56, 55, 96, 197, 61, 91, 164, 216, 21, 55, 249, 245, 77, 117, 193, 179, 75, 89, 217, 244, 51, 96, 191, 166, 63, 131, 250, 48, 219, 41, 56, 154, 81, 70, 196, 251, 140, 2