} func computeChecksum(message []byte) [16]byte { var checksum [16]byte var L byte = 0 // Inicializa L com 0 // Percorre a mensagem em blocos de 16 bytes for i := 0; i < len(message); i += 16 { for j := 0; j < 16; j++ { c := message[i+j] checksum[j] ^= SBox[c^L] // Calcula o novo valor do checksum L = checksum[j] // Atualiza L para o próximo passo } } return checksum
} 3 - Processamento Principal Agora pegamos a mensagem com padding e checksum e a processamos utilizando um buffer intermediário de 48 bytes . O objetivo desta fase é misturar os dados de forma não linear para aumentar a resistência a colisões. Diferente de outros algoritmos como o MD4 e MD5, que usam operações de rotação bitwise para aumentar a difusão dos bits, o MD2 utiliza apenas operações XOR e tabelas de substituição (S-Box). Isso se deve ao fato de que ele foi projetado para arquiteturas de 8 bits , onde operações bitwise mais complexas poderiam ser ineficientes. Estrutura do Buffer de 48 Bytes O buffer de processamento (X) é um array de 48 bytes , onde os primeiros 16 bytes armazenam o hash intermediário, os segundos 16 bytes armazenam um bloco da mensagem e os últimos 16 bytes contêm a mistura do bloco da mensagem com os primeiros 16 bytes. X = [H(0) H(1) .. H(15) | M(0) M(1)... M(15) | H(0) XOR M(0), ... , H(15) XOR M(15)] Onde: H representa os primeiros 16 bytes do buffer, que armazenam o estado atual do hash. M representa os 16 bytes do bloco da mensagem sendo processado. Etapas do Processamento A cada bloco de 16 bytes , fazemos o seguinte: Copiamos o bloco da mensagem (M) para os bytes 16 a 31 do buffer. Criamos a mistura dos primeiros 16 bytes (H) com o bloco M , armazenando nos bytes 32 a 47. Executamos 18 rodadas de processamento, onde aplicamos XOR sequencialmente nos 48 bytes do buffer usando a tabela S-Box. O número 18 não foi escolhido arbitrariamente: ele está relacionado ao fato de que o MD2 foi projetado para rodar eficientemente em arquiteturas de 8 bits. Como a S-Box tem 256 valores possíveis (8 bits), e um bloco do MD2 possui 16 bytes, Rivest determinou que 18 rodadas forneciam difusão suficiente sem comprometer o desempenho em hardware de baixa capacidade. Esse valor foi escolhido de forma empírica para equilibrar segurança e eficiência computacional. Cada rodada segue esta fórmula: X[j] = X[j] XOR SBox[T]
T = X[j] Sendo que T é um acumulador que começa em zero e é atualizado ao longo da iteração. Isso garante que o hash seja alterado a cada rodada, propagando as mudanças nos bytes de maneira não linear. Exemplo de Transformação Suponha que o buffer X comece com: X = [ A1 A2 ... A16 | B1 B2 ... B16 | C1 C2 ... C16 ] Após aplicar a permutação com a S-Box , obtemos: X' = [ P1 P2 ... P16 | Q1 Q2 ... Q16 | R1 R2 ... R16 ] Essa transformação acontece 18 vezes , garantindo uma alta difusão dos bits. A implementação do processamento principal segue abaixo: func processMD2Blocks(message []byte) [16]byte { var X [48]byte // Buffer intermediário de 48 bytes for i := 0; i < len(message); i += 16 { // Copia o bloco da mensagem para os bytes 16 a 31 do buffer copy(X[16:32], message[i:i+16]) // Preenche os últimos 16 bytes com H ⊕ M for j := 0; j < 16; j++ { X[32+j] = X[j] ^ X[16+j] } var T byte = 0 // 18 rodadas de processamento for round := 0; round < 18; round++ { for j := 0; j < 48; j++ { X[j] ^= SBox[T] // Permutação não linear usando a S-Box T = X[j] // Atualiza T } T += byte(round) // Incrementa T a cada rodada } } // O hash final é extraído dos primeiros 16 bytes do buffer X var hash [16]byte copy(hash[:], X[:16]) return hash
} Conceitos Aplicados Este processamento principal do MD2 explora três princípios fundamentais da criptografia: Confusão ([Shannon, 1949][1]) A permutação S-Box adiciona um grau de não linearidade ao algoritmo, tornando difícil estabelecer relações diretas entre a entrada e a saída. Difusão ([Shannon, 1949][1]) Cada byte do hash final depende de todos os bytes da mensagem de entrada, devido à aplicação iterativa da S-Box e do XOR. Avalanche Effect Pequenas mudanças na entrada resultam em grandes mudanças no hash, pois cada rodada mistura bits de diferentes partes da mensagem. Após esse processo, os primeiros 16 bytes do buffer X formam o hash MD2 final.

