package main import ( "fmt"
) // Tabela de permutação S-box
var S = [256]byte{ 41, 46, 67, 201, 162, 216, 124, 1, 61, 54, 84, 161, 236, 240, 6, 19, 98, 167, 5, 243, 192, 199, 115, 140, 152, 147, 43, 217, 188, 76, 130, 202, 30, 155, 87, 60, 253, 212, 224, 22, 103, 66, 111, 24, 138, 23, 229, 18, // (o restante foi omitido por brevidade, consulte a RFC 1319)
} func MD2(input []byte) [16]byte { // Parte 1: Padding paddingSize := 16 - (len(input) % 16) padding := make([]byte, paddingSize) for i := range padding { padding[i] = byte(paddingSize) } input = append(input, padding...) // Parte 2: Checksum var checksum [16]byte var L byte = 0 for i := 0; i < len(input); i += 16 { for j := 0; j < 16; j++ { checksum[j] ^= S[input[i+j]^L] L = checksum[j] } } input = append(input, checksum[:]...) // Parte 3: Transformação Principal var X [48]byte for i := 0; i < len(input); i += 16 { // Copia bloco para X copy(X[16:32], input[i:i+16]) for j := 0; j < 16; j++ { X[32+j] = X[16+j] ^ X[j] } var t byte = 0 // 18 rounds de processamento for round := 0; round < 18; round++ { for j := 0; j < 48; j++ { X[j] ^= S[t] t = X[j] } t += byte(round) } } // O hash final está nos primeiros 16 bytes de X var hash [16]byte copy(hash[:], X[:16]) return hash
} func main() { data := []byte("Mensagem de teste") hash := MD2(data) fmt.Printf("MD2 Hash: %x\n", hash)
}

