func md2Transform(message []byte) [16]byte { var X [48]byte for i := 0; i < len(message); i += 16 { copy(X[16:32], message[i:i+16]) for j := 0; j < 16; j++ { X[32+j] = X[j] ^ X[16+j] } var T byte = 0 for round := 0; round < 18; round++ { for j := 0; j < 48; j++ { X[j] ^= SBox[T] T = X[j] } T += byte(round) } } var hash [16]byte copy(hash[:], X[:16]) return hash
} // Função principal MD2
func MD2(input []byte) [16]byte { padded := md2Padding(input) checksum := md2Checksum(padded) message := append(padded, checksum[:]...) return md2Transform(message)
} // Função para comparar com a implementação oficial
func compareWithLibrary(input string) { hash := MD2([]byte(input)) fmt.Printf("Nosso MD2: %x\n", hash) libHash := md2.New() libHash.Write([]byte(input)) fmt.Printf("MD2 OpenSSL: %x\n", libHash.Sum(nil))
} func main() { testInput := "Mensagem de teste" compareWithLibrary(testInput)
} Podemos comparar também com o openssl para ver se a mensagem bate: echo -n "Mensagem de teste" | openssl md2 Ataques Contra o MD4 O MD4 foi um grande avanço na época, mas também teve falhas graves de segurança. Aqui, exploramos os ataques mais relevantes que levaram à sua obsolescência. 1 - Ataque de Colisão (1995) - Hans Dobbertin Em 1995, o criptógrafo Hans Dobbertin publicou um ataque prático contra o MD4, demonstrando que era possível encontrar colisões em alguns segundos. Isso quebra a confiabilidade do algoritmo, pois qualquer atacante pode substituir um documento sem alterar seu hash. Como Dobbertin quebrou o MD4? Ele explorou fraquezas estruturais nas três rodadas do MD4, usando um método conhecido como differential cryptanalysis. Ele encontrou colisões em menos de 1 minuto usando um computador comum da época! 2 - Ataque de Colisão Rápido (2007) - Wang et al. Em 2007, Xiaoyun Wang, Hongbo Yu e Yiqun Lisa Yin aprimoraram os ataques de Dobbertin e conseguiram gerar colisões em tempo real. 3 - Ataque de Pré-imagem (2009) Em 2009, pesquisadores mostraram que dado um hash MD4, era possível reconstruir uma entrada que produzia o mesmo valor. Esse ataque é catastrófico para aplicações que dependem de integridade, como assinaturas digitais. 4 - Ataque a Senhas no NTLM (Windows) O MD4 foi usado no NTLM (Microsoft Windows Authentication). Como os ataques de colisão e pré-imagem são rápidos, foi possível quebrar senhas NTLM em milissegundos.

