} /* Essa função realiza a operação de expansão e permutação. Explicação: Ela recebe um slice de N bytes e uma tabela de permutação de N bytes e retorna um slice de N bytes. A tabela é usada para determinar a ordem dos bits no slice de entrada e no slice de saída. podemos ter valores repetidos, o que significa que a mesma posição de bit pode aparecer em várias posições na saída. Isso permite expandir a saída para um tamanho maior do que a entrada. Exemplos: Simples sem expansão: Entrada: [A, B, C, D] (4 bits, cada letra equivale a {0,1}) Tabela: [3, 1, 2, 4] (posições de bits) Saída: [C, A, B, D] (4 bits, cada letra equivale a {0,1}) Com expansão: Entrada: [A, B, C, D] (4 bits, cada letra equivale a {0,1}) Tabela: [3, 1, 2, 4, 1, 2] (posições de bits) Saída: [C, A, B, D, A, B] (6 bits, cada letra equivale a {0,1}, repete o A e o B) Restrições: Os valores na tabela devem estar no intervalo [1, N], onde N é o tamanho do slice de entrada. Isso garante que não tente acessar posições inválidas no slice de entrada. Funções Auxiliares: getBit: Essa função recebe um slice de bytes e uma posição (0-indexed) e retorna o bit correspondente. setBit: Essa função recebe um slice de bytes, uma posição (0-indexed) e um valor (0 ou 1) e "seta" o bit correspondente. +----------------+-----------------+-------------------+------------------+------------+--------------------------------------+ | Nome da tabela | Bits de entrada | Tamanho da tabela | Bits de saída | Tipo | Uso | +----------------+-----------------+-------------------+------------------+------------+--------------------------------------+ | IP | 64 | 64 | 64 | permutação | Permutação inicial | +----------------+-----------------+-------------------+------------------+------------+--------------------------------------+ | IPInv | 64 | 64 | 64 | permutação | Permutação final | +----------------+-----------------+-------------------+------------------+------------+--------------------------------------+ | PC1 | 64 | 56 | 56 | seleção | Redução da chave (remove paridade) | +----------------+-----------------+-------------------+------------------+------------+--------------------------------------+ | PC2 | 56 | 48 | 48 | seleção | Geração das subchaves | +----------------+-----------------+-------------------+------------------+------------+--------------------------------------+ | E (EBox) | 32 | 48 | 48 | expansão | Parte da função f | +----------------+-----------------+-------------------+------------------+------------+--------------------------------------+ | P (PBox) | 32 | 32 | 32 | permutação | Após as S-boxes, dentro de f | +----------------+-----------------+-------------------+------------------+------------+--------------------------------------+
*/
func permute(input, table []byte) []byte { n := len(table) output := make([]byte, (n+7)/8) for i, pos := range table { bit := getBit(input, int(pos)-1) setBit(output, i, bit) } return output
} func getBit(data []byte, pos int) byte { byteIndex := pos / 8 bitIndex := 7 - (pos % 8) return (data[byteIndex] >> bitIndex) & 1
} func setBit(data []byte, pos int, value byte) { byteIndex := pos / 8 bitIndex := 7 - (pos % 8) if value == 1 { data[byteIndex] |= (1 << bitIndex) } else { data[byteIndex] &^= (1 << bitIndex) }
} /*
f: Função usada em cada rodada do DES Descrição: - Recebe os 32 bits da metade direita R (4 bytes) e a subchave da rodada (48 bits = 6 bytes). - Aplica a expansão E para transformar R em 48 bits. - Realiza XOR entre o resultado e a subchave. - Divide em 8 blocos de 6 bits e aplica as 8 S-boxes. - A saída (32 bits) é permutada com a tabela P e retornada. Etapas: R (32) -> expansão E (48) -> XOR com subchave -> S-boxes (48 -> 32) -> permutação P (32) -> saída
*/
func f(R []byte, subkey []byte) []byte { // Etapa 1 Expande R de 32 para 48 bits R48 := permute(R, E[:]) // 6 bytes // Etapa 2 XOR com subchave x := xor(R48, subkey) // Etapa 3 Aplicar S-boxes sboxOut := make([]byte, 4) // 32 bits = 4 bytes for i := 0; i < 8; i++ { offset := i * 6 val := uint8(0) for j := 0; j < 6; j++ { bit := getBit(x, offset+j) val |= bit << (5 - j) } row := ((val & 0x20) >> 4) | (val & 0x01) // bits 1 e 6 col := (val >> 1) & 0x0F // bits 2 a 5 sboxVal := S[i][row*16+col] // Inserir 4 bits resultantes no sboxOut for j := 0; j < 4; j++ { bit := (sboxVal >> (3 - j)) & 1 setBit(sboxOut, i*4+j, bit) } } // Etapa 4 Permutação final (PBox) return permute(sboxOut, P[:])
} // Realiza XOR bit a bit entre dois slices de mesmo comprimento.
func xor(a, b []byte) []byte { if len(a) != len(b) { panic("tamanhos diferentes no xor") } out := make([]byte, len(a)) for i := range a { out[i] = a[i] ^ b[i] } return out
} /*
generateSubkeys: Gera as 16 subchaves de 48 bits a partir da chave original de 64 bits. Descrição: - Aplica PC1 à chave original (64 bits) para obter 56 bits sem paridade. - Converte esses bits em slices puros de bits (0 ou 1). - Divide em dois blocos de 28 bits: C (esquerda) e D (direita). - Executa rotações circulares definidas pela tabela Rotations. - Concatena C || D e aplica PC2 para gerar a subchave de 48 bits da rodada. - Armazena cada subchave no campo `d.subkeys`. Parâmetros: - key: [8]byte — chave original de 64 bits (com bits de paridade). Retorno: - error: retorna erro se houver falha inesperada (não esperado com chave válida).
*/
func (d *DES) generateSubkeys(key [KeySize]byte) error { // Aplica PC1 -> 56 bits key56 := permute(key[:], PC1[:]) // 7 bytes = 56 bits // Converte key56 para slice de bits (cada bit é 0 ou 1) bits := bytesToBits(key56) // Divide bits em C e D (28 bits cada) C := make([]byte, 28) D := make([]byte, 28) copy(C, bits[:28]) copy(D, bits[28:]) for i := 0; i < NumRounds; i++ { // Rotações circulares à esquerda C = rotateLeft(C, int(Rotations[i])) D = rotateLeft(D, int(Rotations[i])) // Concatena C || D CD := append(C, D...) // Aplica PC2 -> 48 bits subkeyBits := permuteBits(CD, PC2[:]) // 48 bits subkey := bitsToBytes(subkeyBits) // 6 bytes copy(d.subkeys[i][:], subkey) } return nil
} /*
bytesToBits: Converte um slice de bytes em um slice de bits. Descrição: - Cada byte é decomposto em seus 8 bits (MSB primeiro). - O resultado é um slice com bits individuais representados como 0 ou 1 (byte). Parâmetros: - data: slice de bytes. Retorno: - Slice de bits com tamanho len(data) * 8.
*/
func bytesToBits(data []byte) []byte { bits := make([]byte, len(data)*8) for i := 0; i < len(bits); i++ { bits[i] = getBit(data, i) } return bits
} /*
bitsToBytes: Converte um slice de bits (0 ou 1) em um slice de bytes. Descrição: - Agrupa os bits a cada 8 posições para formar bytes. - Bits são tratados no formato MSB primeiro. - Se a quantidade de bits não for múltiplo de 8, o último byte é preenchido à esquerda. Parâmetros: - bits: slice de bits (0 ou 1). Retorno: - Slice de bytes correspondente.
*/
func bitsToBytes(bits []byte) []byte { n := (len(bits) + 7) / 8 data := make([]byte, n) for i := 0; i < len(bits); i++ { setBit(data, i, bits[i]) } return data
} /*
permuteBits: Realiza uma permutação direta sobre um slice de bits. Descrição: - Usa a tabela de permutação (1-based) para reorganizar os bits do slice. - Cada valor da tabela especifica a posição do bit original a ser copiado. Parâmetros: - input: slice de bits (0 ou 1). - table: tabela de permutação (valores entre 1 e len(input)). Retorno: - Slice de bits permutado.
*/
func permuteBits(input []byte, table []uint8) []byte { out := make([]byte, len(table)) for i, pos := range table { out[i] = input[pos-1] } return out
} /*
rotateLeft: Executa uma rotação circular à esquerda em um slice de bits. Descrição: - Roda n posições os bits de entrada para a esquerda. - Bits deslocados à esquerda são recolocados no fim do slice. Parâmetros: - input: slice de bits (0 ou 1). - n: número de posições a rotacionar. Retorno: - Novo slice com bits rotacionados.
*/
func rotateLeft(input []byte, n int) []byte { n %= len(input) return append(input[n:], input[:n]...)
} /*
Encrypt: Cifra um bloco de 64 bits usando o algoritmo DES. Descrição: - Aplica a permutação inicial (IP) sobre o bloco de entrada. - Divide o bloco em L0 e R0 (32 bits cada). - Executa 16 rodadas de Feistel, onde: - Li = Ri-1 - Ri = Li-1 XOR f(Ri-1, subkey_i) - Após as rodadas, concatena R16 || L16 (note a inversão). - Aplica a permutação final (IPInv) para gerar o bloco cifrado. Parâmetros: - plaintext: [8]byte (64 bits) — bloco de entrada. Retorno: - [8]byte: bloco cifrado. - error: reservado para casos futuros (atualmente sempre nil).
*/
func (d *DES) Encrypt(plaintext [BlockSize]byte) ([BlockSize]byte, error) { fmt.Printf("Plaintext (hex): %x\n", plaintext) fmt.Printf("Plaintext (bits): %08b\n", plaintext) permuted := permute(plaintext[:], IP[:]) fmt.Printf("After IP: %x\n", permuted) L, R := permuted[:4], permuted[4:] fmt.Printf("L0: %x\n", L) fmt.Printf("R0: %x\n", R) for i := 0; i < NumRounds; i++ { fOut := f(R, d.subkeys[i][:]) fmt.Printf("Round %2d - Subkey: %x\n", i+1, d.subkeys[i]) fmt.Printf("Round %2d - f(R, K): %x\n", i+1, fOut) Li := R Ri := xor(L, fOut) fmt.Printf("Round %2d - L: %x\n", i+1, Li) fmt.Printf("Round %2d - R: %x\n", i+1, Ri) L, R = Li, Ri } fmt.Printf("Preoutput (R || L): %x%x\n", R, L) preoutput := append(R, L...) finalOutput := permute(preoutput, IPInv[:]) fmt.Printf("Final Output: %x\n", finalOutput) var out [BlockSize]byte copy(out[:], finalOutput) return out, nil
} /* Decrypt: Decifra um bloco de 64 bits usando o algoritmo DES. Descrição: - Aplica a permutação inicial (IP) sobre o bloco cifrado. - Divide em L0 e R0 (32 bits cada). - Executa 16 rodadas de Feistel no sentido inverso (chaves na ordem reversa): - Li = Ri-1 - Ri = Li-1 XOR f(Ri-1, subkey_i) - Após as rodadas, concatena R16 || L16 (inversão). - Aplica a permutação final (IPInv) para obter o plaintext original. Parâmetros: - ciphertext: [8]byte (64 bits) — bloco cifrado. Retorno: - [8]byte: bloco decifrado. - error: reservado para casos futuros (atualmente sempre nil).
*/ func (d *DES) Decrypt(ciphertext [BlockSize]byte) ([BlockSize]byte, error) { permuted := permute(ciphertext[:], IP[:]) L, R := permuted[:4], permuted[4:] for i := NumRounds - 1; i >= 0; i-- { Li := R Ri := xor(L, f(R, d.subkeys[i][:])) L, R = Li, Ri } preoutput := append(R, L...) finalOutput := permute(preoutput, IPInv[:]) var out [BlockSize]byte copy(out[:], finalOutput) return out, nil
} /* main: Função de teste e demonstração (driver) do algoritmo DES. Descrição: - Define chave e bloco de teste conforme especificação do padrão FIPS PUB 81. - Instancia o algoritmo DES com a chave dada. - Cifra o bloco de 64 bits e imprime o resultado em hexadecimal. - Decifra o resultado e verifica se o texto recuperado é idêntico ao original. - Se tudo estiver correto, imprime sucesso. Teste FIPS: - Chave: 133457799BBCDFF1 - Bloco: 0123456789ABCDEF - Esperado: 85E813540F0AB405 (cifrado) Objetivo: - Verificar se a implementação segue o comportamento padronizado do DES.
