package main import ( "fmt"
) type PRNG struct { state uint8 taps []int
} // inicializa com uma semente
func srand(seed uint8) *PRNG { return &PRNG{state: seed, taps: []int{7, 5}}
} // gera um único bit pseudo-aleatório
// é como jogar uma moeda para escolher 0 ou 1, só que deterrminístico
func (p *PRNG) nextBit() uint8 { var feedback uint8 for _, tap := range p.taps { feedback ^= (p.state >> tap) & 1 } out := p.state & 1 p.state = (p.state >> 1) | (feedback << 7) return out
} // gera um número pseudo-aleatório de 8 bits
// obtido a partir de 8 chamadas de nextBit()
func (p *PRNG) rand() uint8 { var b uint8 for i := 0; i < 8; i++ { b |= p.nextBit() << i } return b
} func main() { // inicializa o gerador com uma semente prng := srand(0b11001010) fmt.Println("Gerando 10 números pseudo-aleatórios com LFSR:") for i := 0; i < 10; i++ { fmt.Printf("rand() = %3d (0b%08b)\n", prng.rand(), prng.rand()) }
}

