O gerador congruencial linear (LCG) é um Pseudo-Random Number Generator (PRNG) que produz uma sequência de números inteiros por meio de uma fórmula de recorrência , que define cada novo número com base no anterior. Si​+1=A⋅Si​+Bmodm Esta fórmula diz que, para obter o próximo valor da sequência (Si​+1), pegamos o valor atual (Si​), multiplicamos por um número fixo A, somamos um descolamento B, e aplicamos o módulo m para que o resultado fique dentro de um intervalo limitado. O que significa recorrência? Recorrência é um termo matemático para uma definição que depende do próprio valor anterior. É como uma função que chamamos com os resultados anteriores, p.ex.: S0 := 123456 // semente inicial
S1 := (A * S0 + B) % m
S2 := (A * S1 + B) % m
S3 := (A * S2 + B) % m
// ... A sequência inteira S0​,S1​,S2​,… é construída recursivamente a partir da semente inicial S0​. Esse tipo de estrutura é comum em geradores determinísticos, pois com os mesmos parâmetros iniciais e a mesma semente, a sequência será sempre igual. Os valores Si​ são números inteiros, mas o tamanho pode variar dependendo da aplicação. Em teoria, Si​∈Zm​, ou seja, um número de 0 até m−1. Em código, os valores são frequentemente armazenados em um tipo de dado inteiro de 32 ou 64 bits para casos simples ou em um big.Int para suportar números maiores (e.g. um valor com 100 bits). Às vezes, o número inteiro é dividido em bits, caso a aplicação exigir uma saída bit a bit (como no caso de construir uma key stream para cifra de fluxo). Os parâmetros fixos: A,B,m A é chamado de multiplicador e controla o "rítmo" de variação da sequência. B é chamado de incremento e adiciona uma constante a cada passo. m é chamado de módulo e define o tamanho do espaço onde os valores vivem (e.g.: m=232 ou m=264 ou m=2100). O módulo m, além de manter os valores dentro de um intervalo finito (e.g. entre 0 e 232−1) também permite operar em espaços cíclicos, como nos corpos finitos em criptografia. No código, podemos implementar uma função, convenientemente chamada rand, da seguinte forma: package main type PRNG struct { state *big.Int // Estado atual S_i A *big.Int // Multiplicador B *big.Int // Incremento M *big.Int // Módulo
} func (p *PRNG) rand() *big.Int { p.state.Mul(p.A, p.state) // A * S_i p.state.Add(p.state, p.B) // A * S_i + B p.state.Mod(p.state, p.M) // (A * S_i + B) mod m return new(big.Int).Set(p.state)
} func main() { // Inicialização do PRNG A := big.NewInt(1103515245) B := big.NewInt(12345) M := big.NewInt(1 << 32) state := big.NewInt(123456) prng := PRNG{state, A, B, M} for i := 0; i < 10; i++ { fmt.Println(prng.rand()) }
}

