} func padCounter(base string, count int) string { suffix := fmt.Sprintf("%08d", count) return base[:len(base)-len(suffix)] + suffix
} func ctr(entrada []string, iv string) []string { saida := make([]string, len(entrada)) for i, p := range entrada { counter := padCounter(iv, i) keystream := reverse(counter) // aplicar cifra real aqui saida[i] = xor(p, keystream) } return saida
} func reverse(s string) string { runes := []rune(s) for i, j := 0, len(runes)-1; i < j; i, j = i+1, j-1 { runes[i], runes[j] = runes[j], runes[i] } return string(runes)
} func main() { blocos := []string{"ExemploD", "eTextoCr", "iptograf", "ado\x00\x00\x00"} iv := "0000000000000000" // deve ter tamanho fixo saida := ctr(blocos, iv) for i, b := range saida { fmt.Printf("C%d: %q\n", i+1, b) }
} Nesta simulação: O contador é representado por um sufixo decimal no IV A função reverse simula a cifra aplicada ao contador Cada bloco é processado com base em um valor de contador diferente O CTR é amplamente utilizado em prática (por exemplo, em AES-CTR), sendo considerado seguro e eficiente quando o IV não é reutilizado com a mesma chave.

