Para isolar os conceitos, não implementamos uma cifra completa, mas sim funções que exemplificam mecanicamente confusão (via substituições não lineares com chave) e difusão (via permutações e operações de dispersão simples). A estrutura será: Confusão: uso de uma substituição baseada em chave (S-Box parametrizada). Difusão: uso de permutação fixa e dispersão via operações XOR. package main import ( "crypto/sha256" "fmt"
) // Gera uma S-Box pseudoaleatória baseada em uma chave
func generateSBox(key []byte) [256]byte { var sbox [256]byte hash := sha256.Sum256(key) seed := uint32(0) for i := 0; i < 4; i++ { seed ^= uint32(hash[i]) << (8 * i) } for i := range sbox { sbox[i] = byte((i*int(seed) + 31) % 256) } return sbox
} // Confusão: aplica substituição não linear via S-Box
func confusion(input []byte, sbox [256]byte) []byte { out := make([]byte, len(input)) for i, b := range input { out[i] = sbox[b] } return out
} // Difusão: permutação e dispersão via XOR entre posições
func diffusion(input []byte) []byte { out := make([]byte, len(input)) for i := range input { out[i] = input[i] if i > 0 { out[i] ^= input[i-1] } } return out
} func main() { key := []byte("chave-secreta") entrada := []byte("mensagem123456") sbox := generateSBox(key) c := confusion(entrada, sbox) d := diffusion(c) fmt.Printf("Original : %x\n", entrada) fmt.Printf("Confusão : %x\n", c) fmt.Printf("Difusão : %x\n", d)
} Análise do código: Observe que: A função generateSBox cria uma tabela de substituição (S-Box) que introduz confusão, pois depende da chave de entrada. A função diffusion implementa uma difusão simples, propagando a influência de cada byte anterior sobre o próximo com XOR.

