) const base32Table = "ABCDEFGHIJKLMNOPQRSTUVWXYZ234567" func EncodeBase32(data []byte) string { var builder strings.Builder var buffer uint64 var bits uint for _, b := range data { buffer = (buffer << 8) | uint64(b) bits += 8 for bits >= 5 { index := (buffer >> (bits - 5)) & 0b11111 builder.WriteByte(base32Table[index]) bits -= 5 } } if bits > 0 { index := (buffer << (5 - bits)) & 0b11111 builder.WriteByte(base32Table[index]) } for builder.Len()%8 != 0 { builder.WriteByte('=') } return builder.String()
} func main() { entrada := []byte("Ma") fmt.Println("Base32: ", EncodeBase32(entrada))
